import React, { useEffect, useState } from "react";
import Post from "./Post";

var posts = []

async function fetchPosts() {
  let posts = await fetch('https://listnotes.forgiveandforget.workers.dev/').then(
    result => result.json()
    )
  
  return posts
}

function List() {
  let posts = fetchPosts();
  return (
    <ul contentEditable="true" spellCheck="false">
      {
        posts ? (posts.forEach(post=><Post />)) : null
      }
    </ul>
  );
}

export default List;
